Hippocrates said, Let food be thy medicine and medicine be thy food. Just about every nutrition-related professional I know has that quote displayed somewhere in their office, probably to convince reluctant patients that a really smart guy a really long time ago predicted that food could actually heal the body.

<!--more-->Nullam condimentum vel sem sit amet suscipit. Morbi quam metus, aliquam tincidunt lacinia luctus, ornare ut tellus.

&nbsp;

When most people read this quote, they are envisioning lots of plants, lots of whole grains, and yes, what my patients call cardboard  food thats good for our bodies but not our taste buds (taste buds can be trained, by the way, to enjoy foods you never thought you would).

&nbsp;

But I bet no one is envisioning a huge cup of Joe, are they? The fact is, due to its worldwide popularity, coffee is probably the greatest source of antioxidants in the global diet. And while having lots of it isnt recommended for everyone, for some of us, it may just be the super food of the century.

&nbsp;

It may lower your risk of death.

&nbsp;

It helps make your reproductive systems happy.

&nbsp;

It can help lower your risk of developing Type 2 diabetes.

&nbsp;

It helps protect your brain.

